  .up_box{
  position: absolute;
  left: 17%;
  top: 7%;
  width: 900px;
  height: 500px;
  background-color:rgb(42, 41, 58);
  border-radius:10px;
  opacity:0.95;
  
  }

  .buttons{
    display:flex;
    justify-content: center;
    position:absolute;
    top: 45%;
    left: 10%;
  }
  
  .toText{
  position: absolute;
  left: 35%;
  top: 70%;
  border-radius:10px;
  opacity:0.95;
  color:#ddd;
  
  }
  
  
  .mtext{
    color: #ddd;
    font-family: Consolas;
    font-size: 114px;
    position: absolute;
    left: 10%;
    top: 10%;
  }
  
  /* .formfield{
    
  } */
  
  .new{
    position: absolute;
    top: 40%;
    left: 10%;
  }
  
  
  .old{
    position: absolute;
    top: 65%;
    left: 10%;
  }
  input {
    color-scheme: dark;
  }
  
  input[type=text] {
    position: absolute;
    top: 35px; 
    left: 10%;
    color:white;
    width:220px;
    border: 2px solid green;
    padding: 15px 20px;
    border-radius: 4px;
    background-color: #0e3158;
    color: white;
  }
  
  .but {
    display: inline-block;
    padding: 15px 25px;
    width:405px;
    font-size: 24px;
    cursor: pointer;
    text-align: center;
    text-decoration: none;
    outline: none;
    color: #fff;
    background-color: red;
    border: none;
    border-radius: 15px;
  }
  
  .selbut {
    display:inline-block;
    padding: 10px 15px;
    font-size: 24px;
    cursor: pointer;
    text-align: center;
    text-decoration: none;
    outline: none;
    color: #fff;
    background-color: red;
    border: none;
    border-radius: 15px;
  }
  
  
  .but:hover {background-color: red}
  
  
  .but:active {
    background-color: red;
  }
  
  * {box-sizing:border-box}
  
  
  * {box-sizing:border-box}
  
  
  
  .sel_crypto{
  position:absolute;
  width: 220px;
  top: 65%;
  left:40%;
  border: 2px solid green;
  padding: 15px 20px;
  border-radius: 4px;
  background-color: #0e3158;
  color: rgb(143, 139, 139);
  display:flex;
  }
  
  .sel_date{
    display:inline-block;
  position:absolute;
  top: 65%;
  width: 220px;
  left:7%;
  border: 2px solid green;
  padding: 15px 20px;
  border-radius: 4px;
  background-color: #0e3158;
  color: rgb(143, 139, 139);
  display:flex;
  }
  
  .sel{
    display:inline-block;
  position:relative;
  top: 30%;
  width: 220px;
  left:10%;
  border: 2px solid green;
  padding: 15px 20px;
  border-radius: 4px;
  background-color: #0e3158;
  color: rgb(143, 139, 139);
  display:flex;
  }
  
  table{
    position: absolute;
    top:30%;
    left:5%;
    border-collapse: collapse;
    border: 1px solid #ddd;
  }
  
  th{
    border: 1px solid #ddd;
    width:30%;
    padding:5px;
    padding-top: 12px;
    padding-bottom: 12px;
    text-align: left;
    color: white;
  }
  
  td{
    border: 1px solid #ddd;
    width:30%;
    padding:5px;
    padding-top: 12px;
    padding-bottom: 12px;
    text-align: center;
    color: white;
